import Card from "../../../ui/card/Card";
import "./name.scss";

function Name(props: { name: string; knowledge: string }) {
  return (
    <Card className="">
      <div className={styles.subcontainer}>
        <p className={styles.name}>{props.name}</p>
        <p className={styles.knowledge}>{props.knowledge}</p>
      </div>
    </Card>
  );
}

export default Name;
